import React from 'react';

const date = new Date()

const Header = () => {
  return (
    <div>
      <link rel="stylesheet" href="https://stackpath.bootstrapcdn.com/bootstrap/4.3.1/css/bootstrap.min.css" integrity="sha384-ggOyR0iXCbMQv3Xipma34MD+dH/1fQ784/j6cY/iJTQUOhcWr7x9JvoRxT2MZw1T" crossorigin="anonymous"></link>
      <div className="footer d-flex justify-content-center text-center align-items-center pt-1">
        <p className="par text-primary">Copyright {date.getFullYear()} Home360 | Terms of Service</p>
      </div>
      <style>{`
        .footer {
          background: green;
          height: 60px;
          width: 100%;
        }

        .par {
          font-size: 12px;
        }
      `}</style>
    </div>
  )
}

export default Header;
